import { useEffect, useState } from 'react';
import './App.scss';


function App() {
  const linkImg1 = 'data:image/png;base64,'
  const LinkImg2 = 'data:image/png;base64,'
  const LinkImg3 = 'data:image/png;base64,'
  const LinkImg4 = 'data:image/png;base64,'
  const LinkImg5 = 'data:image/png;base64,'
  const LinkImg6 = 'data:image/png;base64,'
  const LinkImg7 = 'data:image/png;base64,'
  const LinkImg8 = 'data:image/png;base64,'
  const LinkImg9 = 'data:image/png;base64,'
  const LinkImg10 = 'data:image/png;base64,'
  const [Data, setdata] = useState<string[]>([linkImg1, LinkImg2, LinkImg3, LinkImg4, LinkImg5])
  const [NewData, setNewdata] = useState<string[]>([linkImg1, LinkImg2, LinkImg3, LinkImg4, LinkImg5])
  const [ListDescription, setListDescription] = useState<string[]>(['air', 'ash', 'dush', 'earth', 'eruption'])
  const MOreDescription = ['energy', 'fire', 'granite', 'fake1', 'fake2']
  const [MoreData, setMoreData] = useState<string[]>([LinkImg6, LinkImg7, LinkImg8, LinkImg9, LinkImg10])
  const [left, setleft] = useState<any>()
  const [right, setright] = useState<any>()
  const [li, setli] = useState<any>()
  var src = ''
  let domimg: any
  let check = true;
  let checkDelete = true;
  const [start, setstart] = useState(0)
  useEffect(() => {
    setleft(document.querySelector('.left'))
    setright(document.querySelector('.right'))
    setli(document.querySelectorAll('.alphabet li'))
  }, [])
  const DragStart = (e: any) => {
    src = e.target.src
    console.log(37, src)
    check = false;
  }
  const Scroll = () => {
    setNewdata([...Data])
    setstart(0)
  }
  if (li) {
    li.forEach((li: HTMLElement) => {
      li.addEventListener('click', (e: any) => {
        let checknumber = true;
        let alphabet = e.target.innerHTML;
        let i = -1;

        ListDescription.forEach((value, index) => {

          if (value[0] == alphabet.toLowerCase() && checknumber) {
            checknumber = false;
            i = index;

          }
        })

        if (i !== -1) {
          let length = Data.length
          let DataRender: string[]
          DataRender = Data.slice(i, length)
          setstart(i)
          setNewdata([...DataRender])
        }

      })
    })
  }
  if (left) {
    left.addEventListener('dragover', (e: any) => {
      e.preventDefault();
    })
    left.addEventListener('drop', (event: any) => {
      if (src !== '') {
        console.log(76, src)
        let img = document.createElement('img');
        img.src = src;
        if (check && checkDelete && domimg) {
          domimg.remove();
        }
        checkDelete = true;
        img.style.position = 'absolute';
        img.style.top = `${event.clientY}px`
        img.style.left = `${event.clientX}px`
        img.addEventListener('dragstart', (e: any) => {
          src = e.target.src
          check = true;
          domimg = e.target
        })
        img.addEventListener('dragover', (e: any) => {
          e.preventDefault();
        })
        img.addEventListener('drop', function Imgdrop(e: any) {
          console.log(96, src)
          console.log(97, e.target.src)
          const checkNewImg = (start: number, data: string[], drop: number, Moredata: string[], out: number, Dataout: string[]) => {
            if ((src === data[start] && e.target.src === Moredata[drop]) || (src === Moredata[drop] && e.target.src === data[start])) {
              src = Dataout[out];
              console.log(101)
              if (!Data.includes(Dataout[out], 0)) {
                console.log(105)
                setdata([...Data, Dataout[out]])
                setNewdata([...Data, Dataout[out]])
                if (Dataout === MoreData) {
                  setListDescription([...ListDescription, MOreDescription[out]])
                }
              }
              if (src) {
                img.src = src;
              }
              e.target.remove();
              if (domimg) {
                domimg.remove();
              }
            }
          }
          checkNewImg(0, Data, 1, Data, 0, MoreData)
          checkNewImg(1, Data, 2, Data, 1, MoreData)
          checkNewImg(2, Data, 3, Data, 2, MoreData)
          checkNewImg(3, Data, 4, Data, 3, MoreData)
          checkNewImg(4, Data, 2, Data, 4, MoreData)
          checkNewImg(0, Data, 3, MoreData, 2, Data)
          checkNewImg(1, MoreData, 2, Data, 4, MoreData)
          checkNewImg(0, MoreData, 2, MoreData, 0, Data)
        });
        img.addEventListener('click', () => {
          check = false;
          checkDelete = false;
        })
        left.appendChild(img);
        src = ''
      }
    })
  }
  if (right) {
    right.addEventListener('dragover', (e: any) => {
      e.preventDefault();
    })
    right.addEventListener('drop', (e: any) => {
      domimg.remove();
    })
  }
  return (
    <div className='main'>
      <div className='left'>
      </div>
      <div className='right_container'>
        <div className='alphabet'>
          <ol>
            <li>A</li>
            <li>B</li>
            <li>C</li>
            <li>D</li>
            <li>E</li>
            <li>G</li>
            <li>H</li>
            <li>I</li>
            <li>K</li>
            <li>L</li>
            <li>M</li>
            <li>N</li>
            <li>O</li>
            <li>P</li>
            <li>Q</li>
            <li>R</li>
            <li>T</li>
            <li>X</li>
            <li>Y</li>
            <li>Z</li>
          </ol>
        </div>
        <div className='right' onScroll={Scroll}>
          {
            NewData.map((src, i) => {
              return <div>

                <img src={src} alt="" onDragStart={(e) => { DragStart(e) }} />
                <p>{ListDescription[start + i]}</p>
              </div>
            })
          }

        </div>
      </div>
    </div>
  )
}

export default App;
